import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from "react-router-dom";

export default function GridItem({ produto }) {
    const navigate = useNavigate();

    const movimentar = () => {
        navigate(`/MovimentarProduto/${produto.id}`);
    };

    return (
        <li className="list-group-item d-flex justify-content-between align-items-center">
            <div className="font-weight-bold">Código EAN:{produto.id}<div/>
            <div className="font-weight-bold">Nome: {produto.nome}</div>
            <div className="font-weight-bold">Preço: R${produto.preco}</div>
            <div className="font-weight-bold">Categoria: {produto.categoria} </div>
               {/*  


                <div className="font-weight-bold">Quantidade: {produto.quantidade} </div>*/}
            </div>
            <button className="btn btn-primary" onClick={movimentar}>Movimentar</button>
        </li>
    );
}
